
<!DOCTYPE html>
<html lang="de">
<head>
<meta charset="UTF-8">
<title>The World For You</title>
<style>
body {
    margin:0;
    font-family: Arial, sans-serif;
    background:#0d0d0d;
    color:white;
}
header {
    text-align:center;
    padding:40px 20px;
    background: linear-gradient(180deg,#000,#111);
}
header img {
    max-width:300px;
    border-radius:10px;
}
h1 {
    margin-top:20px;
    font-size:36px;
    letter-spacing:2px;
}
h2 {
    text-align:center;
    margin-top:40px;
    font-size:32px;
}
.products {
    display:flex;
    flex-wrap:wrap;
    justify-content:center;
    gap:20px;
    padding:20px;
}
.product {
    width:260px;
    background:#1a1a1a;
    padding:20px;
    border-radius:12px;
    box-shadow:0 0 10px #000;
    text-align:center;
}
button {
    background:#444;
    color:white;
    padding:10px 20px;
    border:none;
    border-radius:5px;
    cursor:pointer;
}
footer {
    text-align:center;
    padding:30px;
    margin-top:40px;
    background:#000;
}
a {
    color:white;
}
</style>
</head>
